// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VaccineTracking {
    struct VaccineBatch {
        string batchId;
        string manufacturer;
        uint256 productionDate;
        uint256 expiryDate;
        bool isValid;
    }

    mapping(string => VaccineBatch) public vaccineBatches;

    event BatchRegistered(string batchId, string manufacturer);
    event BatchVerified(string batchId, bool isValid);

    function registerBatch(
        string memory _batchId,
        string memory _manufacturer,
        uint256 _productionDate,
        uint256 _expiryDate
    ) public {
        require(bytes(_batchId).length > 0, "Batch ID required");
        require(bytes(_manufacturer).length > 0, "Manufacturer required");
        require(_productionDate < _expiryDate, "Invalid dates");

        vaccineBatches[_batchId] = VaccineBatch(
            _batchId,
            _manufacturer,
            _productionDate,
            _expiryDate,
            true
        );

        emit BatchRegistered(_batchId, _manufacturer);
    }

    function verifyBatch(string memory _batchId) public view returns (bool) {
        return vaccineBatches[_batchId].isValid;
    }

    function invalidateBatch(string memory _batchId) public {
        require(bytes(vaccineBatches[_batchId].batchId).length > 0, "Batch not found");
        vaccineBatches[_batchId].isValid = false;
        emit BatchVerified(_batchId, false);
    }
}
